function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div id="nav-bar">
        <nav>
            <label class="logo">Stevens Lost & Found Tool</label>
            <ul>
              <li><a class="navb" href="#">Home</a></li>
              <li><a class="navb" href="report.html">Report Lost Item</a></li>
              <li><a class="navb" href="#">Find an Item</a></li>
              <li><a class="navb" href="about.html">About</a></li>
            </ul>
        </nav>
        </div>
      </header>
    </div>
  );
}

export default App;
